import React from "react";
import { Link, withRouter } from 'react-router-dom';

import './instruction-btn.css';

const InstructionBtn = ({ history }) => {

    return (
        <Link to='/instruction'

        >
            <button className='instruction-btn'
                    onClick={() => history.push('/instruction')}>
                <p className='instruction-btn__text'>Инструкция по препорату Резокластин</p>
            </button>
        </Link>
    )
};

export default withRouter(InstructionBtn);
